import React, { Component } from "react";
import "./App.css";
import UploadPhoto from "./images/upload_file.png";

class App extends Component {
  state = {
    items: [
      {
        id: 1,
        product_name: "Pen",
        quantity: 35,
        measurement: "Piece",
        original_price: 25,
        profit: 10,
        selling_price: 35,
        supplier: "Smart Supplier"
      },
      {
        id: 2,
        product_name: "Pen",
        quantity: 35,
        measurement: "Piece",
        original_price: 25,
        profit: 10,
        selling_price: 35,
        supplier: "Smart Supplier"
      }
    ]
  };

  render() {
    return (
      <div className="main-container">
        <div className="header" id="item-1">
          <h1>Simple Inventory System</h1>
        </div>
        <table class="items-container">
          <tr>
            <th>#</th>
            <th>Product Name</th>
            <th>Quantity</th>
            <th>Measurement</th>
            <th>Original Price</th>
            <th>Profit</th>
            <th>Selling Price</th>
            <th>Supplier</th>
            <th>Delete</th>
            <th>Edit</th>
          </tr>
          {this.state.items.map(items => (
            <tr>
              <td>{items.id}</td>
              <td>{items.product_name}</td>
              <td>{items.quantity}</td>
              <td>{items.measurement}</td>
              <td>{items.original_price}</td>
              <td>{items.profit}</td>
              <td>{items.selling_price}</td>
              <td>{items.supplier}</td>
              <td>Delete</td>
              <td>Edit</td>
            </tr>
          ))}
        </table>
      </div>
    );
  }
}

export default App;
